import React from 'react';
import ReactDOM from 'react-dom';
import Start from './Start';
import openSocket from 'socket.io-client';

const socket = openSocket('http://localhost:5000');

ReactDOM.render(
  <React.StrictMode>
    <Start socket={socket}/>
  </React.StrictMode>,
  document.getElementById('root')
);
